CREATE TABLE `allocation_order` (
  `order_id` varchar(30) NOT NULL COMMENT '调拨ID',
  `shop_id` varchar(30) NOT NULL COMMENT '商铺ID',
  `shop_name` varchar(128) NOT NULL COMMENT '商铺名称',
  `src_sh_id` varchar(30) NOT NULL COMMENT '源仓库ID',
  `src_sh_name` varchar(128) NOT NULL COMMENT '源仓库名称',
  `target_sh_id` varchar(30) NOT NULL COMMENT '目标仓库ID',
  `target_sh_name` varchar(128) NOT NULL COMMENT '目标仓库名称',
  `state` varchar(12) NOT NULL COMMENT '状态，1001 待审核 2002 待入库 3003 审核失败 4004 完成',
  `staff_id` varchar(30) NOT NULL COMMENT '员工ID',
  `staff_name` varchar(64) NOT NULL COMMENT '员工名称',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `status_cd` varchar(2) NOT NULL DEFAULT '0' COMMENT '有效标识',
  `remark` varchar(512) DEFAULT NULL COMMENT '备注',
  `target_shop_Id` varchar(30) NOT NULL COMMENT '目标商铺',
  `target_shop_name` varchar(30) NOT NULL COMMENT '目标商铺',
  `product_count` varchar(255) NOT NULL COMMENT '调拨数量',
  `state_remark` varchar(512) DEFAULT NULL COMMENT '审核备注',
  `product_id` varchar(30) NOT NULL COMMENT '商品id',
  `spec_id` varchar(30) NOT NULL COMMENT '规格ID',
  PRIMARY KEY (`order_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

