-- ----------------------------
-- Table structure for store_order
-- ----------------------------
DROP TABLE IF EXISTS `store_order`;
CREATE TABLE `store_order` (
  `order_id` varchar(30) NOT NULL COMMENT '订单ID',
  `o_id` varchar(30) NOT NULL COMMENT '订单ID',
  `person_id` varchar(30) NOT NULL COMMENT '用户ID',
  `person_name` varchar(256) NOT NULL COMMENT '用户名称',
  `total_price` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '订单总价',
  `pay_price` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '实际支付金额',
  `freight_price` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '运费金额',
  `state` varchar(12) NOT NULL DEFAULT '0' COMMENT '订单状态（0：待发货；1：待支付 ；2：待收货；3：已收货；4 待评价 5：已退款,6 : 申请退款 7 : 退货成功 ）',
  `ext_order_id` varchar(64) DEFAULT NULL COMMENT '外部订单ID',
  `remark` varchar(512) DEFAULT NULL COMMENT '订单备注',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建日志',
  `app_id` varchar(30) NOT NULL COMMENT '应用ID',
  `app_name` varchar(64) NOT NULL COMMENT '应用名称',
  `deduction` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '抵扣金',
  `service_fee` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '服务费',
  `pay_order_id` varchar(64) DEFAULT NULL COMMENT '支付订单号',
  `profit_sharing` varchar(12) NOT NULL COMMENT 'F 已分账 W 未分账 N 不用分账',
  `shop_id` varchar(30) NOT NULL DEFAULT '-1' COMMENT '商铺ID',
  PRIMARY KEY (`order_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of store_order
-- ----------------------------

-- ----------------------------
-- Table structure for store_order_address
