DROP TABLE IF EXISTS `store_order_address`;
CREATE TABLE `store_order_address` (
  `oa_id` varchar(30) NOT NULL COMMENT '主键ID',
  `address_id` varchar(30) NOT NULL COMMENT '地址ID',
  `order_id` varchar(30) NOT NULL COMMENT '订单ID',
  `username` varchar(64) NOT NULL COMMENT '收货人',
  `tel` varchar(11) NOT NULL COMMENT '电话',
  `area_code` varchar(10) NOT NULL COMMENT '地区编号',
  `address` varchar(200) NOT NULL COMMENT '地址',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `status_cd` varchar(2) NOT NULL DEFAULT '0' COMMENT '数据状态，详细参考c_status表，S 保存，0在用，1失效',
  PRIMARY KEY (`oa_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

