-- ----------------------------
-- Table structure for store_order_cart
-- ----------------------------
DROP TABLE IF EXISTS `store_order_cart`;
CREATE TABLE `store_order_cart` (
  `cart_id` varchar(30) NOT NULL COMMENT '购物车ID',
  `order_id` varchar(30) NOT NULL COMMENT '订单ID',
  `product_id` varchar(30) NOT NULL COMMENT '产品ID',
  `value_id` varchar(30) NOT NULL COMMENT '产品规格值ID',
  `store_id` varchar(30) NOT NULL COMMENT '商户ID',
  `person_id` varchar(30) NOT NULL COMMENT '用户ID',
  `cart_num` decimal(8,2) NOT NULL COMMENT '购买数量',
  `price` decimal(8,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '商品金额',
  `pay_price` decimal(8,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '实际支付金额',
  `freight_price` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '运费金额',
  `state` varchar(30) NOT NULL DEFAULT '1001' COMMENT '状态，1001 未购买 2002 已支付 ',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `status_cd` varchar(2) NOT NULL DEFAULT '0' COMMENT '数据状态',
  `remark` varchar(512) DEFAULT NULL COMMENT '管理员备注',
  `prod_name` varchar(128) NOT NULL COMMENT '商品名称',
  `shop_id` varchar(30) NOT NULL COMMENT '商铺ID',
  `ext_cart_id` varchar(30) DEFAULT NULL COMMENT '购物车ID',
  `cart_type` varchar(12) NOT NULL DEFAULT '3306' COMMENT '3306商品 3307 家政服务',
  `area_code` varchar(12) DEFAULT NULL,
  `deduction` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '抵扣金',
  `order_sn` varchar(64) DEFAULT NULL COMMENT '供应链订单ID',
  `ext_prod_id` varchar(64) DEFAULT NULL COMMENT '外部订单ID',
  `ext_value_id` varchar(64) DEFAULT NULL COMMENT '外部',
  `su_type` varchar(12) DEFAULT NULL COMMENT '供应链类型：0手动添加，1京东供应链',
  `cs_id` varchar(30) DEFAULT NULL COMMENT '外部',
  PRIMARY KEY (`cart_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

