-- ----------------------------
-- Table structure for store_order_cart_event
-- ----------------------------
DROP TABLE IF EXISTS `store_order_cart_event`;
CREATE TABLE `store_order_cart_event` (
  `event_id` varchar(30) NOT NULL COMMENT '事件ID',
  `order_id` varchar(30) NOT NULL COMMENT '订单ID',
  `cart_id` varchar(30) NOT NULL COMMENT '购物车ID',
  `event_obj_type` varchar(12) NOT NULL DEFAULT 'U' COMMENT '事件类型，U 用户触发，S商户触发,J 定时任务触发',
  `event_obj_id` varchar(30) DEFAULT NULL COMMENT '触发对象',
  `event_msg` longtext NOT NULL COMMENT '事件内容',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '事件触发时间',
  `shop_id` varchar(30) NOT NULL COMMENT '商铺ID',
  `event_type` varchar(12) NOT NULL COMMENT '类型，7012 通用类型 7013 用户催单',
  PRIMARY KEY (`event_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

