-- ----------------------------
-- Table structure for store_order_cart_fee
-- ----------------------------
DROP TABLE IF EXISTS `store_order_cart_fee`;
CREATE TABLE `store_order_cart_fee` (
  `detail_id` varchar(30) NOT NULL COMMENT '明细ID',
  `cart_id` varchar(30) NOT NULL COMMENT '购物车ID',
  `shop_id` varchar(30) NOT NULL COMMENT '商铺ID',
  `price` decimal(8,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '金额',
  `pay_price` decimal(8,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '支付金额',
  `pay_way` varchar(30) NOT NULL COMMENT '支付方式',
  `state` varchar(30) NOT NULL DEFAULT '1001' COMMENT '状态，1001 未支付 2002 已支付 ',
  `fee_config_id` varchar(30) NOT NULL DEFAULT '-1' COMMENT '费用标准ID，商品时填写-1',
  `fee_name` varchar(128) NOT NULL COMMENT '费用名称，商品时填写商品名称',
  `ext_order_id` varchar(64) DEFAULT NULL COMMENT '外部订单ID 线上支付时的，支付系统的支付ID',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `status_cd` varchar(2) NOT NULL DEFAULT '0' COMMENT '数据状态',
  `remark` varchar(512) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`detail_id`)
