  `cart_id` varchar(30) NOT NULL COMMENT '购物ID',
  `person_id` varchar(30) NOT NULL COMMENT '申请退货用户ID',
  `state` varchar(12) NOT NULL COMMENT '状态，1001 退货申请 2002 退货成功 3003 退货失败 4004 退款成功 5005 退款失败',
  `return_reason` longtext NOT NULL COMMENT '退款原因',
  `return_pay_price` decimal(8,2) NOT NULL COMMENT '退款金额',
