  `shop_id` varchar(30) NOT NULL COMMENT '商铺ID',
  `return_cart_num` bigint NOT NULL COMMENT '退货数量',
  `return_type` varchar(12) NOT NULL COMMENT '退单类型1001 订单退单 2002 订单项退单',
  PRIMARY KEY (`return_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

